Music by @GrooveIury

To record this Futuristic Synthwave, drum samples were used in Splice and a korg minilogue synthesizer for the melodies. Everything was recorded through the Tascam Porta7, giving a true cassette tape timbre. There are some variants for the lead and bass synth, the more complex being rarer.

The visual work was based on the Lin–Shu Density Wave Theory that describes the spiral structure of galaxies, simulating:
an axis of rotation;
points of gravitational force;
different sizes for the core of the galaxy;

Added a Morph feature = variation of star size) and some unique features tied to the hash.
